import Layout from '../components/Layout'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee } from '@fortawesome/free-solid-svg-icons'
import { faCannabis } from '@fortawesome/free-solid-svg-icons'
import { faJoint } from '@fortawesome/free-solid-svg-icons'
import { faBong } from '@fortawesome/free-solid-svg-icons'
import Link from 'next/link'


const Index = () => (
    <Layout>
        <>
            <h1>The Menu</h1>
            <div id="icons">
                <div id="coffee">
                    <FontAwesomeIcon icon={faCoffee} height="150px" width="150px">
                        <Link href="#"><a className="nav-link">coffee</a></Link>
                    </FontAwesomeIcon>
                </div>

                <div id="cannabis">
                    <FontAwesomeIcon icon={faCannabis} height="150px" width="150px" />
                </div>
                <div id="joint">
                    <FontAwesomeIcon icon={faJoint} height="150px" width="150px" />
                </div>
                <div id="bong">
                    <FontAwesomeIcon icon={faBong} height="150px" width="150px" />
                </div>
            </div>
            <style jsx>
                {`
               h1 {
                   text-align: center;
                   margin-top: 10px;
               }
               #coffee {
                   color: brown;
                   display: inline-block;
                   margin-left: 19%;
                   outline: 2px solid black;
                   border-radius: 20px;
               }
               #cannabis {
                   color: green;
                   display: inline-block;
                   margin-left: 15px;
               }
               #joint {
                   color: brown;
                   display: inline-block;
                   margin-left: 15px;
               }
               #bong{
                display: inline-block;
                margin-left: 15px;
                color: blue;
               } 
               `}
            </style>
        </>
    </Layout>
)

export default Index;
